import React from "react";
import Item from "./Item";

const ItemList = () => {
    const items = ['BOOKS', 'LAPTOP', 'HEADPHONES', 'MOBILES', 'All-Accessories'];

    return(
        <>
        <h1>ITEMS ARE DIPLSYED HERE!!!!!</h1>
        <ul>
            {items.map((item, index) => (
             <Item id={index} name={item} />   
            )

            )

            }
        </ul>
        </>
    );
};
export default ItemList;
